<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Cookie Alert</title>
  <style>
    /* Configurações gerais */
    body, html {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      font-family: Arial, sans-serif;
      height: 100%;
      overflow: hidden; /* Impede rolagem */
      display: flex;
      justify-content: center; /* Centraliza horizontalmente */
      align-items: center;    /* Centraliza verticalmente */
    }

    /* Wrapper do fundo */
    .background-container {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      overflow: hidden;
    }

    /* Iframe para o fundo */
    .background-iframe {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      border: none; /* Remove borda padrão do iframe */
      filter: blur(8px); /* Aplica desfoque */
      z-index: -2; /* Coloca o iframe atrás de tudo */
    }

    /* Máscara preta com opacidade */
    .background-mask {
      position: absolute;
      top: 0;
      left: 0;
      width: 100%;
      height: 100%;
      background: rgba(0, 0, 0, 0.5); /* Fundo preto semitransparente */
      z-index: -1; /* Fica acima do iframe */
    }

    /* Pop-up de cookies */
    .cookie-popup {
      width: 300px; /* Altura e largura iguais para formar um quadrado */
      height: 300px;
      background: #fff;
      border-radius: 10px; /* Bordas levemente arredondadas */
      box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
      text-align: center;
      padding: 20px;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      z-index: 10;
    }

    .cookie-popup h2 {
      font-size: 1.5rem;
      margin-bottom: 10px;
      color: #333;
    }

    .cookie-popup p {
      font-size: 0.9rem;
      color: #666;
      margin: 0 0 15px;
    }

    .accept-button {
      display: inline-block;
      padding: 15px 25px; /* Maior tamanho para destaque */
      font-size: 1.2rem; /* Fonte maior */
      color: #fff;
      background: #e63946;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      text-decoration: none; /* Remove sublinhado do link */
      transition: background 0.3s, transform 0.3s;
      animation: pulse 1.5s infinite; /* Adicionado efeito de pulsar */
    }

    .accept-button:hover {
      background: #d62828;
      transform: scale(1.1); /* Leve zoom ao passar o mouse */
    }

    /* Animação de pulsar */
    @keyframes pulse {
      0% {
        transform: scale(1);
        box-shadow: 0 0 5px rgba(230, 57, 70, 0.5);
      }
      50% {
        transform: scale(1.05);
        box-shadow: 0 0 20px rgba(230, 57, 70, 0.8);
      }
      100% {
        transform: scale(1);
        box-shadow: 0 0 5px rgba(230, 57, 70, 0.5);
      }
    }
  </style>
</head>
<body>

  <!-- Wrapper para o iframe e máscara -->
  <div class="background-container">
    <!-- Iframe no fundo -->
    <iframe 
      src="{affiliate_link}" 
      class="background-iframe" 
      allowfullscreen>
    </iframe>

    <!-- Máscara preta semitransparente -->
    <div class="background-mask"></div>
  </div>

  <!-- Pop-up de cookies -->
  <div class="cookie-popup">
    <h2>Cookie Policy</h2>
    <p>This website uses cookies to ensure the best browsing experience and personalize content. By continuing, you accept the use of cookies.</p>
    <!-- Botão com link -->
   <a href="{affiliate_link}" class="accept-button" onclick="window.location.href=this.href; return false;">
  ACCEPT COOKIES
</a>
  </div>

</body>
</html>
<!-- /wp:html -->

